import React from 'react'
import AboutMeCard from './aboutMeCard'
import HobbiesCard from './hobbiesCard'
import FunFactsCard from './funFactsCard'

export default function aboutMeContainer() {
    const classes = {
        content : {
            margin: '2%'
        },
        flexBox: {
            display: 'flex',
        }
    }
    return (
        <div style={classes}>
            <AboutMeCard />
            <div>
                <HobbiesCard />
                <FunFactsCard />
            </div>
        </div>
    )
}
